import * as React from "react";
import { Link } from "react-router-dom";

function App() {
  return (
    <div>
      <header>
        <h1>Welcome to React Router!</h1>
      </header>
      <Link to="/home">Home</Link>
      <Link to="/login">Login</Link>
    </div>
  );
}
export default App;
